import JsGameMainView from "@/components/Dashboard/GameComponents/JsMission/JsGameMainView.vue";
import JsLvl1 from "@/components/Dashboard/GameComponents/JsMission/JsLvl1.vue";
import JsLvl2 from "@/components/Dashboard/GameComponents/JsMission/JsLvl2.vue";
export default[
    {
        path:'/js-game',
        component:JsGameMainView
    },
    {
        path:'/js-game/lvl-1',
        component:JsLvl1
    },
    {
        path:'/js-game/lvl-2',
        component:JsLvl2
    }
]
